import React from "react";

export default function About() {

  const labelStyle={
    background: "orange",
    display: "flex"
  };
  const paragraphP ={
    background:"red",
    width: "500px",
    padding: "10px",
    fontSize: "25px",
    borderRadius: "30px",
  };
  return (
    <div>
      <h1>About Our Coffee Shop</h1>
      <div style={labelStyle}><p style={paragraphP}>
        At Daily Grind Coffee House, we believe that every cup of coffee tells a story.
        Nestled in the heart of Bongabong,  we're more than just a coffee shop-we're a place where 
        a place where early risers, late-night thinkers, and weekend wanderers come together over 
        expertly brewed coffee and handcrafted treats. 
      </p
      >
      <p style={paragraphP}>
        Our passion for rich flavors and high quality beans drives us to serve the best espresso,
        lattes, and cold brews in town. Whether you're here for a quick caffeine fix or a cozy spot 
        to work and unwind, we've got you covered with our warm ambiance and friendly baristas.
      </p>
      </div>
    </div>
  );
}
